INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Arabian', 'arabian.zip', null, 0, null, null, null, null, 'Arabian is a rarity for Atari''s arcade efforts -- a climber/platform game -- in which players lead a wanna-be Arabian Knight through various locales kicking monsters and birds out of the way before they touch him and cost the player a life. The action begins aboard a ship at sea, and later to an island and then a castle. Urns with letters on them are peppered around the screen and must be touched in the correct order to spell ''ARABIAN'' for bonus points -- but beware of a huge genie that occasionally pops out of an urn to grab any adventurers within his grasp. The player''s man can scale ladders and ropes, hang overhead from horizontal ropes, and hop from flying carpet to flying carpet (similar to Frogger''s river logs) to navigate each level.');
