INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('ASO - Armored Scrum Object', 'aso.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Assault', 'assault.zip', null, 0, null, null, null, null, 'Ion Assault is a twinstick shooter with a space ship, set in enclosed arenas in space similar to Geometry Wars. The left stick is used for movement and the right one for aiming, shown through a red laser. The goal is to survive waves of enemies and space debris (mainly rocks, splitting up into smaller elements similar to Asteroids), but there is a twist to it. Rather than shooting directly, the ship can activate a mass reactor, slightly slowing down movement, but it enables the ship to gather a large mass of ions floating in the arena and concentrate it around the ship. These can then be fired in the desired direction and the amount determines the damage. These ions ricochet off walls and can therefore target multiple enemies, or be caught, before they spread out in the playfield again. There are no other basic means of attack, so the ''bullets'' are all around the field to be gathered and recycled again.');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Assault ', 'assaultj.zip', null, 0, null, null, null, null, '');
