INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Burger Time ', 'btime.zip', null, 0, null, null, null, null, 'The player is chef Peter Pepper, who must walk over hamburger ingredients located across a maze of platforms while avoiding pursuing characters. The game''s original Japanese title, Hamburger (ハンバーガー?), was changed to BurgerTime before its introduction to the United States.In the United States, Data East USA licensed BurgerTime for distribution by Bally Midway as a standard dedicated arcade game. Data East also released its own version of BurgerTime in the US through the DECO Cassette System. The Data East and Midway versions are distinguished by the manufacturer''s name on the title screen and by the marquee and cabinet artworks, as the game itself is identical.');
