INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Black Widow', 'bwidow.zip', null, 0, null, null, null, null, 'Black Widow is a vector arcade game developed by Atari released in 1982. The player takes the role of a Black widow spider defending a web from invading bugs. The player must move the spider around the web while simultaneously shooting/avoiding various bugs and collecting the bonuses that appear after the enemies are eliminated. The spider is controlled through two joysticks: the left one is used to move the spider, and the right one to control the shot direction.');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Battle Zone ', 'bzone.zip', null, 0, null, null, null, null, 'In 1980, Battlezone stunned the world by presenting the first game in 3-D. Two decades later, Battlezone - This Means War, developed by Activision company, reinvade the game univero with a genre that combines first-person action and strategy in real time, as revolutionary as it was the first title.In Battlezone player combat in 1st person and command attacks with over 30 different units at the same time it manages the resources available over seven moons and planets');
