INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ''88 ', 'galag88b.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ', 'galaga.zip', null, 0, null, null, null, null, 'Galaga 2 (Europe) or Galaga ''91 (Japan) is a sequel to Namco''s 1981 arcade classic, Galaga (brought to the SG-1000 as Sega-Galaga). It is actually a port of Galaga ''88, originally released in arcades in 1988, retitled to reflect its Sega Game Gear release of 1991.Galaga ''91 can cause confusion not just because of its arcade origins three years prior, but because in Europe, this Game Gear version was retitled (again) as Galaga 2, being marketed as a direct sequel to Galaga. It is, however, the fourth game in the series; being preceeded by the 1979 arcade game, Galaxian, Galaga in 1981 and finally Gaplus in 1984 (sometimes called Galaga 3 - an equally misleading title). To make matters worse, Namco released an arcade sequel called Galaxian³ (also known as Galaxian 3'') in 1990, and the TurboGrafx-16 port of Galaga ''88/''91 is called Galaga ''90. More recent games have opted to avoid numbering systems and always use the Galaga name.Galaga ''88/''91 builds on the gameplay seen in Galaxian, Galaga and Gaplus, the most notable addition being the inclusion of more detailed backgrounds (as opposed to coloured scrolling starfields). The Game Gear version was not released in North America.');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga 3 ', 'galaga3.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga 3 ', 'galaga3a.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ''84', 'galaga84.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ''88 ', 'galaga88.zip', null, 0, null, null, null, null, 'Galaga ''88 is a 1987 fixed shooter arcade game by Namco. It is the third sequel for Galaxian (following Galaga, and Gaplus). It features significantly improved graphics over the previous games in the series, including detailed backgrounds, larger enemies and greater ship details. Although it was well received, fewer cabinets of this game were produced than of Galaga and Gaplus. The game runs on Namco System 1 hardware. It was later released on the North American TurboGrafx-16 under the name Galaga ''90 and the Sega Game Gear in Japan under the name of Galaga''91 (ギャラガ''91 Gyaraga ''Nainti Wan?), and in Europe under the name of Galaga 2.The gameplay in Galaga ''88 is built on the same premise as that of the original Galaga game, but is in many ways more complex and more difficult. The game is divided into a series of 29 Stages distributed through eight Worlds. The starship Galaga accelerates between Stages and Worlds and even to higher dimensions');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ''88 ', 'galaga88j.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ', 'galagab2.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Galaga ', 'galagads.zip', null, 0, null, null, null, null, '');
