INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Jungler', 'jungler.zip', null, 0, null, null, null, null, 'In Jungler, the player controls a white, multi-segmented animal inside a blue maze. Also inside the maze are three enemy creatures similar to that of the player. The object of the game is to eliminate the enemy creatures before one of them eliminates the player. When all three enemies are defeated, the player advances to the next maze.The enemy creatures appear in one of three colors: red, yellow or green. Red creatures are longer in length than the player, and as such a collision with the creature will cost the player one life. Yellow creatures are the same length as the player, thus posing no harm upon a collision. Green creatures are shorter than the player, and will be devoured by the player''s creature if they collide. The player can shoot at the creatures, with each hit reducing the number of segments by one. As segments are removed, the creatures are able to move faster, thus making them harder to catch and eliminate.Points are scored for shooting the creatures, as well as for collecting pieces of fruit that appear in the maze at random locations. These fruits will also add an extra segment to the player''s creature.');
