INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Lunar Lander ', 'llander.zip', null, 0, null, null, null, null, 'The objective of Lunar Lander is to pilot a lunar landing module as it prepares to touch down on the moon. The terrain is very jagged and has only a few flat areas appropriate for landing. These areas are highlighted with a flashing bonus multiplier, which is higher for smaller areas. If the player successfully lands the module, he or she is awarded points based on how good the landing was and the difficulty of the landing site. If he or she crashes, points are awarded based on the severity of the crash and sometimes the player receives a fuel penalty. In either case, the game starts another round with a different set of terrain and the player''s remaining fuel. The game is over when the player has run out of fuel and crashes on the moon''s surface.');
