INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Moon Cresta ', 'mooncrsg.zip', null, 0, null, null, null, null, 'Moon Cresta (ムーンクレスタ?) is an arcade game released in 1980 by Nichibutsu. A moving starfield gives the impression of vertical scrolling, but the game is a fixed shooter in the vein of Namco''s Galaxian.Incentive Software published a version of this arcade game for many 8-bit home computers of the time. Dempa also released a port of both Moon Cresta and Terra Cresta for the X68000. It was also released on the Wii Virtual Console in Japan on March 9, 2010 and PlayStation 4(Arcade Archives) in 2014.[2]');
