INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Paperboy', 'paperboy.zip', null, 0, null, null, null, null, 'Hop on your bike for a free-wheeling ride up the avenues of not-so-typical suburbia. There are papers to be delivered, robbers to be foiled, and fame and fortune to be won as you brave the mean streets. Avoid motorcycles, tricycles, traffic, tires, gratings, curbs, dogs, skateboarders, breakdancers, bad guys, and other hazards as you deliver to your customers. Earn bonus points by hitting targets along the obstacle course at the end of your route. With superb animation and sound effects, Paperboy brings home all the thrills, spills, challenge, and excitement you loved in the arcades.');
