INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Punch-Out!!', 'punchout.zip', null, 0, null, null, null, null, 'Punch-Out!! It''s 13 tough matches in the minor, major and world circuits that lead to the final challenge - the World Video Boxing Association title fight. The ultimate bout against the newest WVBA Champ - Mr. Dream! Practice your hook and take a quick jab. Try to stay light on your feet as you dance left, then right, dodging punches while you throw your own. Boxers from around the world like Piston Honda, Glass Joe and Super Macho Man are all trying to knock you out of the ring. You''ve trained for months for this moment. There''s the bell. Shake hands and come out boxing!');
