INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Street Fighter ', 'sf.zip', null, 0, null, null, null, null, 'Street Fighter II′ is an 8-bit version of Capcom''s revolutionary arcade fighting game Street Fighter II to the Sega Master System by TecToy in 1997. It is not a port of any specific version of Street Fighter II, but rather it is a mix between the Mega Drive versions of Street Fighter II'': Special Champion Edition and Super Street Fighter II: The New Challengers, mixing elements from both. The title itself, Street Fighter II′, features the same blue fonts as the Champion Edition logo, as well as the prime symbol (′) next to the numeral, which is pronounced Dash in Japan, but is usually unspoken overseas.Though severely watered down due to the weaker hardware of the SMS, this version of Street Fighter II is still a reasonably faithful rendition of the game. It also features the announcer''s vocals which the Mega Drive''s Special Champion Edition lacked. However, the game is held back by a lack of moves (the Master System only has two buttons on its controller, as opposed to the six used in the arcade game) and character voice samples, and the framerate is low. The music has also been tweaked in places.The SMS version only retains 8 fighters out of the 12 character roster from Special Champion Edition. E. Honda, Zangief, Dhalsim and Vega (Claw) are the four fighters who did not made the cut. None of the additional fighters from New Challengers (Cammy, T. Hawk, Fei-Long and Dee-Jay) are present either, despite the use of character portraits from that version.The character-specific endings are also not present in this version either: instead the ending screen consists of portraits of Balrog, Sagat and M. Bison (the same ones used in Special Champion Edition when the player clears the game using a boss character) with a generic message underneath. The staff roll is also lifted straight from Special Champion Editon, but with the addition of people who worked specifically on this version.');
