INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Street Fighter II - The World Warrior ', 'sf2b.zip', null, 0, null, null, null, null, '');
INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Street Fighter II'' - Champion Edition ', 'sf2ce.zip', null, 0, null, null, null, null, 'Street Fighter II'': Champion Edition  is a competitive fighting game released for the arcades by Capcom in 1992. It was the first of several updated versions of the original Street Fighter II: The World Warrior. The main changes consisted of the addition of the Grand Masters (the final four computer-controlled opponents in the single-player mode) as playable characters and mirror matches (same character vs. matches). The fighting techniques of the eight main characters from the original game were also further refined to allowed for more balanced competitive play.Champion Edition was followed by Street Fighter II'' Turbo: Hyper Fighting, released several months later.');
