INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Space Harrier', 'sharrier.zip', null, 0, null, null, null, null, 'HELP! Deep in the 214th sector of the universe, a distress signal is sent from a land in turmoil. Under attack and besieged by countless monstrous beings, Fantasyland is fighting a losing battle. But wait, help is on the way! The heroic Space Harrier has jettisoned into their time warp via intergalactic teleportation. Armed with the same laser blaster that made Space Harrier victorious in the Land of the Dragons, you''ve got a host of vicious enemies to destroy. Space phantoms, multi-headed reptiles and wicked wizards are just a few of the targets to set your sights on. And they''re everywhere. So keep your eyes on ''em, shoot straight, and keep moving. One false move and it''s the end for you and Fantasyland!');
