INSERT INTO SMUAdminConsole.possible_roms (game_name, file_name, rom_loc, rom_active, game_time_played, game_last_active, last_edit_id, image_loc, game_desc) VALUES ('Toobin'' ', 'toobin.zip', null, 0, null, null, null, null, 'Toobin'' involves Biff and Jet racing their way down the rapids of a river, riding on tires. You rotate your tyre left or right, and drift as the current sends you, making sure to avoid the banks of the river, and the dividing lines in the middle. Hazards include crocodiles, stray logs and branches, and fishermen - you are armed with a limited supply of tin cans to take care of these. There are gates to slide through on the way down - these give you a points bonus. Each level has a strict time limit to adhere to, although there''s a kickin'' party at the end if you succeed.');
